import React from 'react';

const TrackerInfo = [
   {
      id: '1234',
      name: 'Task 1',
      start: '',
      end: ''
   }
]

const Home = () => (
   <div>
      {TrackerInfo.map( ({id, name, start, end}) => (
         <div key={id}>{name}</div>
      ))}
   </div>
)

export default Home;
